import React, { useState, useEffect }from 'react';
import Map from '../components/Map/Map';
import '../App.scss';

export default function Home() {
    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/members", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify({ipaddress: "8.8.8.8"}),
        }).then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])

    return (
        <div className='Container'>
            <h1>Home</h1>
            <p>Welcome to <em>Packet Mapper</em> !</p>
            <p>This tool can give you a visual as to where your packet travels through the internet!</p>
            <p>Insert an IP address below, and see tracerouting in action!</p>
            {(typeof data.members === "undefined")?(
                <p>Loadidng...</p>
            ):(
                data.members.map((member, i) => (
                    <p key={i}>{member}</p>
                ))
            )

            }
            <p>here</p>
        </div>
    );
}
